const MainSettings = () => {
  const [selectMethod, setSelectMethod] = useState("sun");

  return (
    <div className={styles.main__settings}>
      <h3>Asosiy sozlamalar</h3>
      <ul className={styles.theme__methods}>
        {themeMethods.map((item) => (
          <li
            key={item.key}
            className={clsx(
              styles.item,
              item.key === selectMethod && styles.selected
            )}
            onClick={() => setSelectMethod(item.key)}
          >
            <span className={styles.img}>{item.img}</span>
            <span className={styles.icon}>{item.icon}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MainSettings;
